import React from 'react';
import ReactDOM from 'react-dom';

const name = "sania";
const lname = "faizan";
const img1='https://picsum.photos/200/300'
ReactDOM.render(
<>
<h1 contentEditable='true'>{`Hello my name is ${name} ${lname}`}</h1>
<img src={img1}/>
 </>,
   document.getElementById('root'));
